[application]

name="Play Programming"
main_scene="res://engine/BootScreen.scn"
disable_stdout=false
icon="res://player_art/npc_blue.png"
target_fps=30
boot_logo=img(rgb, 0, 800, 560, )
auto_accept_quit=true

[autoload]

global="res://src/global.gd"

[display]

width=800
height=560
fullscreen=false
stretch_mode="2d"
driver="GLES2"
resizable=false
stretch_aspect="keep"

[image_loader]

filter=false
gen_mipmaps=false

[input]

ui_accept=[jbutton(0, 0)]
move_up=[key(Up)]
move_left=[key(Left)]
move_right=[key(Right)]
move_bottom=[key(Down)]
jump=[key(Space)]
text_editor=[key(T)]

[render]

default_clear_color=#ff000000
thread_model=1
mipmap_policy=0
light_discard_enabled=true
